function showInitialWindow()
win = disp:AddWindow({
	ID = 'InitialScreen',
	WindowTitle = 'Shadertoy Installer',
	Geometry = {675, 300, 550, 420},
	Spacing = 10,

	ui:VGroup{
		ID = 'root',
			ui:TextEdit{
				Weight = 0.8,
				ID = "",
				ReadOnly = true,
				Flat = true,
				Alignment = {
					AlignHCenter = true,
					AlignTop = true,
				},
				HTML = Logo(),
				Events = {AnchorClicked = true},
				MinimumSize = {384, 120},
			},		
			ui:Label{
				Weight = 1.0,
				ID = 'TextLabel',
				Text = [[
				<h2>Welcome to the Shadertoyfuses Setup</h2>
                <center><style>  table {border-collapse: collapse;  }  th, td {border: 1px solid red;padding: 5px;text-align: left;  }</style><table>  <tr><td>CrossDistance</th><td>RainbowSlices</th><td>DancyTreeDoodle</th>  </tr>  <tr><td>Fake3DScene</td><td>TNTHTW</td><td>Favela</td>  </tr>  <tr><td>Noisecube</td><td>LonelyVoxel</td><td>CrackerCars</td>  </tr>  <tr><td>Kali3D</td><td>Crazyness</td><td></td>  </tr></table></center>
				<p>If you want More, Please Visit Our Githubsite:</p>
				<br><a href="https://github.com/nmbr73/Shadertoys" style="color: rgb(139,155,216)">https://github.com/nmbr73/Shadertoys</a><br>]],
				Alignment = {
					AlignHCenter = true,
					AlignVCenter = true,
				},
				WordWrap = true,
				OpenExternalLinks = true,
			},
		-- Add your GUI elements here:
			ui:HGroup{
				Weight = 15.01,
				-- Add a horizontal spacer
				ui:HGap(0, 2.0),

				ui:Button{
					ID = "Install",
					Text = "Next",
				},
			},
			ui:HGroup{
				Weight = 15.01,
				-- Add a horizontal spacer
				ui:HGap(0, 2.0),

				ui:Button{
					ID = "Cancel",
					Text = "Cancel",
				},
			},
		},						
})

-- The window was closed
function win.On.InitialScreen.Close(ev)
		disp:ExitLoop()
end

-- Add your GUI element based event functions here:
itm = win:GetItems()

function win.On.Install.Clicked(ev)
	win:Hide()		
  install()	
	showFinalWindow()
end


function win.On.Cancel.Clicked(ev)
	disp:ExitLoop()
end



win:Show()
disp:RunLoop()
win:Hide()

return win,win:GetItems()
end

showInitialWindow()

